  Claiborne Aquifer in Arkansas, Alabama, Louisiana, Missouri, Mississippi, and Tennessee.
  The hydrogeologic unit dataset contains 414 rows and 394 columns representing 1-mile
  grid spacing. In general, limitations of data interpolation included areas of sparse
  geophysical log control points, log datums not clearly defined for some logs, unknown
  exact extent of each hydrogeologic unit in subcrop, interpolation limitations, and
